function addChordH(b,a){addChord(b,"H",2,function(c){addMute(c,"LowE");addBarre(c,1,"A","HighE");addFretPress(c,3,["D","G","H"])},a)}function addChordHm(b,a){addChord(b,"Hm",2,function(c){addMute(c,"LowE");addBarre(c,1,"A","HighE");addFretPress(c,2,"H");addFretPress(c,3,["D","G"])},a)}function addChordHm7(b,a){addChord(b,"Hm7",2,function(c){addMute(c,"LowE");addBarre(c,1,"A","HighE");addFretPress(c,2,"H");addFretPress(c,3,["D"])},a)};